	DECLARE totalAcres DECIMAL(9,3);
	DECLARE totalParcels INT;

	SELECT count(0), sum(parcel.acres)
	INTO totalParcels, totalAcres
	FROM `parcel` WHERE `land_owner_id` = NEW.land_owner_id;

